Taxonomic methods. All WA Museum specimens of
Teyl
currently known from the Pilbara bioregion of Western Australia were examined for this study, and are listed below and mapped ( Fig. 2 ) either as a named species or as unidentified juveniles. Specimens were examined and described in 70% ethanol under a Leica MZ16A dissecting microscope, following preservation in 70% or 95% ethanol. Digital images were taken using a Leica DFC500 camera attached to a Leica MZ16A microscope, and processed using Leica Application Suite (LAS) version 2.5.OR1 software. All measurements are in millimetres (to one decimal point), and total length measurements include the chelicerae, in dorsal view, but exclude the spinnerets. Leg I measurements were made along the dorsal edge of each segment, in prolateral view. Specimens are lodged at the Western Australian Museum, Perth (WAM) or the South Australian Museum, Adelaide (SAM). The following abbreviations are used throughout the text:
ALE , anterior lateral eye/s
;
AME , anterior median eye/s
;
IBRA , Interim Biogeographic Regionalisation of Australia Version 7 (online at https://www.environment.gov.au/land/nrs/science/ibra
);
PIL , Pilbara bioregion
;
PLE , posterior lateral eye/s
;
PME , posterior median eye/s
.

subSubSection.paragraph:
Remarks. The tribe Anamini is an unambiguously monophyletic assemblage of nine genera, characterized by a strongly developed posterior maxillary heel bearing a field of cuspules ( Fig. 8 ), in combination with an absence of tarsal claw tufts, and two rows of teeth on the paired claws (both family-level characters; see Raven 1985 ;
Harvey et al. 2018
). The burrows of these spiders are almost exclusively open, and often include a secondary escape shaft which branches off from the burrow proper (hence the other commonly applied name of ‘wishbone’ spiders; see Main 1993 ). The tribe is distributed Australia-wide, and the Australian fauna is remarkably diverse, with 100–200 new species (and likely many more) still to be described (
Castalanelli et al. 2014
;
Harvey et al . 2018
; MSH, MGR, JAH, unpublished data).

Description.

Holotype
male

(
Figs 4–16
): Total length 13.9. Carapace 5.2 long, 4.4 wide. Abdomen 6.9 long, 3.7 wide. Carapace (
Fig. 4
) oval, tan-brown with darker brown markings along furrows, sparse downy setation and rows of darker scattered black setae on pars cephalica and pars thoracica; lateral margins with evenly-spaced fringe of anteriorly curved, porrect black setae, longest posteriorly; fovea straight. Eye group (
Fig. 7
) rectangular, 0.5 × as long as wide, PLE–PLE/ALE–ALE ratio 1.0; AME separated by less than their own diameter; PME separated by 4.7 × their own diameter; PME and PLE almost contiguous. Maxillae each with field of 
ca
. 50 cuspules confined to inner ‘heel’ and proximal corner (
Fig. 8
); labium without cuspules. Abdomen (
Fig. 5
) elongate-oval, dark grey-brown in dorsal view and paler beige-brown laterally and ventrally, with irregular beigebrown mottling on posterior dorsal half. Legs (
Figs 11–13
) tan-brown, with light scopulae on tarsi I–II and distal half of metatarsi I–II; tibia I marginally excavate distally, with row of 3 large and 1 smaller ventral macrosetae (most obvious in retrolateral view; 
Fig. 13
), plus 2 retrolateral and 6 prolateral macrosetae (
Figs 12, 13
); metatarsus I ventrally excavate and slightly concave proximally, with pair of short distal macrosetae (
Fig. 11
); tarsus I without macrosetae. Leg I: femur 4.8; patella 2.8; tibia 3.6; metatarsus 3.7; tarsus 2.3; total 17.1. Leg I femur–tarsus/carapace length ratio 3.3. Pedipalpal tibia (
Figs 14–16
) 2.6 × longer than wide, with numerous porrect black macrosetae. Cymbium (
Figs 14–16
) setose, with distal scopula. Bulb (
Figs 14–16
) sub-spherical and unmodified, with reflexed embolus protruding pro-proximally. Embolus (
Figs 14–16
) elongate, ca. 2.0 × length of bulb, strongly curved at base but otherwise relatively straight and posteriorly directed, with thinly tapering tip.

Distribution and remarks.

Teyl heuretes

(formerly known informally by WAM identification code ‘MYG027’; see 

Castalanelli 
et al.
2014

) is an apparently rare species known only from the southern Pilbara bioregion, from the eastern end of the Hamersley Range, north-west of Newman (
Figs 1
, 
2
). A number of additional juvenile specimens have also been recorded from this general area (see below; 
Fig. 2
); however, without sequence data it cannot be confirmed if they are conspecific (albeit likely, especially within the vicinity of Wonmunna and Mudlark). Little is known of the biology of this species, other than that adult males have been collected from pitfall traps in June and July.
